static const size_t g_EventMappingCount = 2817;

// Helper function to build the lookup map (call once at init)
// Generates display labels: "EventName" or "BankName::0xHEXID"
inline void BuildEventMappingTable(std::unordered_map<DWORD, std::string>& outMap) {
    outMap.clear();
    outMap.reserve(g_EventMappingCount);

    for (size_t i = 0; i < g_EventMappingCount; i++) {
        const auto& e = g_EventMappingData[i];
        std::string label;

        if (e.name && e.name[0]) {
            // Resolved: use event name
            label = e.name;
        } else if (e.bank && e.bank[0]) {
            // Unresolved but known bank: BankName::0xHEXID
            char buf[64];
            sprintf_s(buf, "%s::0x%08X", e.bank, e.id);
            label = buf;
        } else {
            // Unknown: bare hex
            char buf[16];
            sprintf_s(buf, "0x%08X", e.id);
            label = buf;
        }

        outMap[e.id] = std::move(label);
    }
}

// Extended helper: also builds event->bank mapping for filtering by loaded banks
inline void BuildEventMappingTableWithBanks(
    std::unordered_map<DWORD, std::string>& outMap,
    std::unordered_map<DWORD, std::string>& outEventSourceBank) {
    outMap.clear();
    outMap.reserve(g_EventMappingCount);
    outEventSourceBank.clear();
    outEventSourceBank.reserve(g_EventMappingCount);

    for (size_t i = 0; i < g_EventMappingCount; i++) {
        const auto& e = g_EventMappingData[i];
        std::string label;

        if (e.name && e.name[0]) {
            label = e.name;
        } else if (e.bank && e.bank[0]) {
            char buf[64];
            sprintf_s(buf, "%s::0x%08X", e.bank, e.id);
            label = buf;
        } else {
            char buf[16];
            sprintf_s(buf, "0x%08X", e.id);
            label = buf;
        }

        outMap[e.id] = std::move(label);

        // Track source bank for this event
        if (e.bank && e.bank[0]) {
            outEventSourceBank[e.id] = e.bank;
        }
    }
}

// Check if an event is uncracked (has TXTP name like "Bank-NNNN" but no semantic name)
inline bool IsEventUncracked(DWORD eventId) {
    for (size_t i = 0; i < g_EventMappingCount; i++) {
        if (g_EventMappingData[i].id == eventId) {
            // Uncracked if name is nullptr OR name matches "Bank-NNNN" pattern
            const char* name = g_EventMappingData[i].name;
            if (!name || name[0] == '\0') return true;
            // Check if name is just bank-nnnn pattern (contains '-' followed by digits)
            const char* dash = strchr(name, '-');
            if (dash && dash[1] >= '0' && dash[1] <= '9') {
                // It's a TXTP name like "Creatures-0442", not a semantic name
                return true;
            }
            return false;
        }
    }
    return true;  // Not in mapping at all = unknown
}

// Get bank name for an event (returns nullptr if not found)
inline const char* GetEventBankName(DWORD eventId) {
    for (size_t i = 0; i < g_EventMappingCount; i++) {
        if (g_EventMappingData[i].id == eventId) {
            return g_EventMappingData[i].bank;
        }
    }
    return nullptr;
}
